	public static int lengthOfLongestSubstring(String s) {
		HashMap<Character, Integer> cache = new HashMap<Character, Integer>();
		int result  = 0;
		int lengthSoFar = 0;
		int startIndex = 0;
		for(int  i = 0; i < s.length(); i++){
			char  curChar = s.charAt(i);
			if(cache.containsKey(curChar)){
				if (cache.get(curChar) < startIndex){
					cache.put(curChar, i);
				}
				else{
					int prevIndex = cache.get(curChar);
					lengthSoFar = i - startIndex;
					result =  Integer.max(lengthSoFar, result);
					startIndex = prevIndex +1;
					cache.put(curChar, i);
				}
			}
			else{
				cache.put(curChar, i);
			}
		}
		int endIndex = s.length();
		return Integer.max(result, endIndex - startIndex);
	}
